Begin swimmerScript

;ENABLES/DISABLES HORKER, GIVES TRAVEL PACKAGE, JOURNAL ENTRIES

short moving
short doOnce

if ( GetDisabled == 0 )
	if ( GetJournalIndex BM_Water < 10 )
		Disable
	elseif ( GetJournalIndex BM_Water >= 70 )
		Disable	
	endif
elseif ( GetDisabled == 1 )
	if ( GetJournalIndex BM_Water == 10 )
		Enable
	endif
endif

if ( GetJournalIndex BM_Water == 10 )
	if ( GetDistance Player <= 256 )
		Journal BM_Water 50
		set moving to 1
	endif
endif

if ( GetJournalIndex BM_Water == 50 )
	if ( GetDistance Player <= 256 )
		if ( doOnce == 0 )
			AiEscort Player 0 -219541.625 217412.188 0 0
			set doOnce to 1
		endif
	endif
endif		

if ( GetJournalIndex BM_Water == 50 )
	if ( moving == 1 )
		if ( GetDistance BM_KA_door_dark_SG <= 2100 )
			if ( GetAiPackageDone == 1 )
				Journal BM_Water 60
			endif
		endif
	endif
endif





End swimmerScript
